import styled from 'styled-components';

// constants
import { MAX_SIZE } from '../constants/index';

const { content } = MAX_SIZE;

export const Container = styled.main`
  padding: 0 15px;
  @media ${(props) => props.theme.breakpoints.DESKTOPMIN} {
    max-width: ${content};
  }
`;
